Male genitalia:
Pygofer about twice as long as greatest width, moderately projected posteriorly, apex slightly widened and rounded; macrosetae very long, distributed along apical third of pygofer (
Fig. 56a
). Valve ovate, margins rounded, curved anterior medially. Plates long, apex pointed, setae plumose (
Fig. 56b
). Style with apophysis short, curved and striate, apex truncate (
Fig. 56c
). In ventral view aedeagus with base narrow; shaft narrow, straight, shorter than ventral processes, apex truncate (
Fig. 56d
). Ventral processes arising at one-fourth length of aedeagus, straight from base, apex pointed. In lateral view, shaft with wide base, curved dorsad, tapering, apex truncate, shorter than ventral processes; dorsal projection short and blunt. Gonopore apical. In lateral view; dorsal projection short, truncate, shaft of aedeagus curved dorsad, almost semicircular. Ventral processes separated from shaft, narrow, curved dorsad, apices very pointed (
Fig. 56e
).
